    "title": "Fire On The Mountain - Official Grateful Dead & Chris Benchetler Film",
    "description": "From the mind of Chris Benchetler comes TGR's latest short film collaboration with Flagship Independent. Improvisation is the silver thread that weaves this crew together. Just as the Grateful Dead did not ﬁt their music into an established category, this short ﬁlm ﬁnds a cast of some of the world’s best athletes on a spontaneous journey of skiing, snowboarding, surfing, and music, complete with a soundtrack comprised of only Grateful Dead music.\n\nNarrated by Hall of Fame basketball player and television sportscaster Bill Walton with music supervision by David Lemieux, audiovisual archivist and legacy manager for the Grateful Dead, Fire On The Mountain features some of action sports’ most legendary athletes: snowboarding’s Jeremy Jones, Danny Davis, Kimmy Fasani, surfing icon Rob Machado, and skiers Michelle Parker and Chris Benchetler. Captured over the course of the winter by cinematographer Tyler Hamlet with the help of Sweetgrass Productions, the visual journey features never seen before visual effects within nature and original artwork by Benchetler and Skye Walker.\n\nMusic Soundtrack: http://bit.ly/FOTMspotify\n\nFollow Chris Benchetler: https://www.instagram.com/chrisbenchetler/\nFollow The Grateful Dead: https://www.instagram.com/gratefuldead/\nFollow Tyler Hamlet: https://www.instagram.com/tylerjhamlet\n\nFor more from Teton Gravity Research, follow us:\nInstagram: https://instagram.com/tetongravity\nFacebook: https://www.facebook.com/tetongravity...\nTwitter: https://twitter.com/tetongravity\nTik Tok: http://vm.tiktok.com/Pw4E1Q/\n\nShop the Dream: http://shop.tetongravity.com\n\n#TGRlivethedream",
